Ghetto Lounge started as a DJ event in Café 1001, Brick Lane since 2003, and is still running today on 2nd and 4th Monday of every month. Ghetto Lounge is also a recording label and promoter of the quality musical culture movement of London, with live performances at "Afrobeat Vibration" bringing the spirit of Fela Kuti and "JAZZ ON THE ROAD" reproducing the style and essence of the ‘beat generation'&#xD;
