Project Pawsitive is a docu-soap that chronicles the rewarding, yet demanding, journey of four friends from New Hampshire as they construct awesome renovations for the most overwhelmed and under-equipped rescues around. With the help of community volunteers,cages transform into lush suites fit for a king, concrete floors become radiant-heated lounge areas, sparse outdoor play areas are reborn as green oasis’, and barks are calmed by Mozart piped through installed music systems.  From dogs and cats to farm animals and reptiles, no rescue is the same after being transformed by the Project Pawsitive team!&lt;br /&gt;
&lt;br /&gt;
Yet, bringing these facilities back from the brink is just one aspect. The team also learns the true meaning of life through the hearts and voices of volunteers sharing their own touching stories about why they have dedicated their lives to giving these animals a second chance.

