Join the Chefs from Le Cordon Bleu College of Culinary Arts and their guests as they discuss inventive and creative food topics&lt;br /&gt;
&lt;br /&gt;
Chef Jae Gruber is a culinary graduate of the Art Institute of Atlanta and also has a degree in Hotel/Restaurant/Tourism Management, specializing in Hotel Management and Special Events.  She has 13 years of experience in the culinary industry.  She has been the Executive Chef of Buckhead Fine Wine and Vino Restaurant and has an extensive background in high-end exclusive catering, kosher catering and as a private chef.  She has also worked as a restaurant consultant in Atlanta and Central America, where she specialized in menu and wine list development, training, and sanitation improvement.  Chef Gruber was the 2006 recipient of the WCR scholarship for Sterling Vineyards Crush Camp.  Chef Gruber is a member and Local Exchange Coordinator for Women&apos;s Chef&apos;s and Restaurateurs and a member of the American Culinary Federation and Slow Foods.  Currently, Chef Gruber is the Executive Sous Chef/Evening Dean of Le Cordon Bleu College of Culinary Arts - Atlanta, where she also teaches Principals of American Cuisine.&lt;br /&gt;
&lt;Chef Rian Macdonald attended Villa Julie College in Stevenson, Maryland for two years and then moved to Phoenix, Arizona where he attended Le Cordon Bleu Culinary Institute in Scottsdale, Arizona.  He graduated with an Associates Degree of Occupational Science in 2005. Chef Macdonald worked as a Sous Chef at the Phoenician Resort in Phoenix for 5 years. He dreams of becoming an instructor and is currently working at Le Cordon Bleu College of Culinary Arts - Atlanta as a High School Recruiter presenting Le Cordon Bleu to students interested in pursuing a culinary career. He is also putting together a cookbook of recipes based on his culinary experiences that he hopes to have published by August of 2009.

