So, you drop your pet off at the local grooming shop, and two hours later- PRESTO!! It looks and smells like a new animal. Magic, right?? Wrong, it’s not magic, folks! Ali McLennan is here to demystify the pet grooming experience for you!!&lt;br /&gt;
&lt;br /&gt;
Ali is a professional pet groomer in NYC's Upper East Side.  She is the grooming expert for Animal Planet's "Underdog to Wonderdog," "Cats 101," Purina Cat Chow, and morning shows across the country. She is passionate about the joy our pets can bring, and will stop at nothing til all your questions are answered! Whether you need advice on a dog, cat, ferret, hamster or iguana, Ali will help.&lt;br /&gt;
&lt;br /&gt;
An educated pet owner is the greatest asset to a professional groomer. Ali will give you at home grooming tips, share experiences from other professional groomers, and take you with her into NYC’s shelters, so you can experience first hand, the difference a little grooming can have on an animal’s well being and your relationship with them!!
Tune in for heartwarming stories, the funny day to day antics of an NYC grooming shop, and essential tips and product recommendations that every pet owner should have, on "Groom for Improvement!!"

