column11:
Im Groovezeichen-Podcast für Musiker und Musikbegeisterte unterhalten sich Andreas Bohl und Lukas Böhnlein über verschiedene Themen der Musik. Beide zusammen produzieren die Band Homosapienz. &lt;/br&gt;&lt;/br&gt;

Andreas Bohl studiert Musikwissenschaft, spielt die Tasteninstrumente bei Homosapienz, sowie in einigen weiteren Bands. Sein Nebeninstrument ist Mandoline.&lt;/br&gt;&lt;/br&gt;

Lukas Böhnlein studiert Geschichte, ist außerdem Tontechniker und ausgebildeter Musikalienhändler. Er ist Sänger und schreibt die Songtexte für Homosapienz. Seine Nebeninstrumente sind Waldhorn und Klavier.
&lt;/br&gt;&lt;/br&gt;

