Founded in 1963, the Guthrie Theater is an American center for theater performance, production, education and professional training, dedicated to producing the great works of dramatic literature, developing the work of contemporary playwrights and cultivating the next generation of theater artists. &lt;br /&gt;
Led by Director Joe Dowling since 1995, the Guthrie opened a new three-theater home on the banks of the Mississippi River in Minneapolis in June 2006. &lt;br /&gt;
Please join us as we offer exclusive podcasts, artist interviews and a look at what goes on behind the scenes. For more information on the Guthrie, visit www.guthrietheater.org.
